import React, { Component } from 'react';

export class Navbar extends Component {
    render() {
      return (
      <nav>
          <ul>
            <li><a href="#">Home</a></li>
            <li><a href="">News</a></li>
            <li><a href="">Contact</a></li>
            <li><a href="">About</a></li>
        </ul>
      </nav>
    );
    }
  }

  export default Navbar;
